import React from 'react';
import PropTypes from 'prop-types';

function Home({ tags }) {

    console.log(tags);

    return (
        <div>
            <h1>Home</h1>
            {tags.length > 0 && tags.map((tag) => (
                <div key={tag}>{tag}</div>
            ))}
        </div>
    );
}

Home.propTypes = {
    tags: PropTypes.object.isRequired,
};

export default Home;